(()=>{"use strict";(t=>{const e=document.getElementById("timer-hours"),n=document.getElementById("timer-minutes"),o=document.getElementById("timer-seconds");setInterval((()=>{let t=(()=>{let t=(new Date("01 october 2023").getTime()-(new Date).getTime())/1e3,e=Math.floor(t%60),n=Math.floor(t/60%60);return{timeRemaining:t,hours:Math.floor(t/60/60),minutes:n,second:e}})();t.timeRemaining>0&&(e.textContent=t.hours.toString().padStart(2,"0"),n.textContent=t.minutes.toString().padStart(2,"0"),o.textContent=t.second.toString().padStart(2,"0"))}),1e3)})()})();